import React from 'react';
import './Frontend.css';
import Button from '@material-ui/core/Button';


class Frontend extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            framework: null
        };
    }

    setFrontend = (value) => {
        this.setState({ framework: value});
    }

    render() {
        return (
            <div className="frontend">
                <h2>Frontend</h2>
                <div className="frameworks">
                    <Button variant="contained" color="primary" onClick={() => this.setFrontend("react")}>
                    React
                    </Button>
                    <Button variant="contained" color="primary" onClick={() => this.setFrontend("angular")}>
                    Angular
                    </Button>
                </div>
            </div>
        );
    }
}

export default Frontend;
